import Axios from "axios"; 

export const Logger =  async (props ) =>{
    let name = props
    let id = 1
    let username = 'test'
    let email = 'test'
    let password = 'test'

    function mapGetter(){
        Axios.get(`http://localhost:3001/api/bejelentkezes/${name}`).then((response) =>{
             id = response.data[0].id
             username = response.data[0].username
             email = response.data[0].email
             password = response.data[0].password 
        }); 
    }mapGetter();
    return{
        id:id,
        username:username,
        email:email,
        password:password
    };
    
};
